import React, { Component } from 'react'
import './footer.less'

export default class Footer extends Component {
    render() {
        return (
            <div className="footer">
            版权所有：杭州斯凯网络科技有限公司（推荐使用谷歌浏览器，可以获得更佳操作页面体验） 技术支持：指易平台
          </div>
        );
    }
}
